import React from "react";
import {Grid, Button, makeStyles, withTheme} from "@material-ui/core";
import {
  Badoo,
  Bebo,
  Behance,
  Blogger,
  Deviantart,
  Digg,
  Disqus,
  Dribbble,
  Facebook,
  Flickr,
  Forrst,
  GooglePlus,
  Instagram,
  Line,
  Linkedin,
  MySpace,
  Pinterest,
  Plurk,
  Rss,
  Skype,
  Telegram,
  Tumblr,
  Twitter,
  Viber,
  Vimeo,
  Vine,
  Vk,
  Whatsapp,
  Xing,
  Youtube,
} from "@trejgun/material-ui-icons-social-networks";

const useStyles = makeStyles(
  theme => ({
    button: {
      margin: theme.spacing(1),
      color: "white",
      borderBlockColor:"white"
    },
    icon: {
      marginRight: theme.spacing(1),
    },
  }),
  {name: "Demo"}
 );

export const Footer = () => {
  const classes = useStyles();
  const footerStyle = {
    position: "relative",
    top: "10vh",
    width: "100%",
  };

  return (
    <footer className="footer has-background-dark" style={footerStyle}>
      <div className="content has-text-centered has-text-white">
      <Button variant="outlined" className={classes.button} >
        <Facebook className={classes.icon} /> Facebook
      </Button>
      <Button variant="outlined" className={classes.button}>
        <Instagram className={classes.icon} /> Instagram
      </Button>
      <Button variant="outlined" className={classes.button}>
        <Linkedin className={classes.icon} /> Linkedin
      </Button>
        <p>
          <strong className="has-text-white">Banking System</strong> created by{" "}
          <a href="https://github.com/vaibhav183">Vaibhav Pandey</a>.
        </p>
      </div>
    </footer>
  );
};
